def FWHM(x_ajustada, y_ajustada):
    mitad = np.max(y_ajustada) / 2
    indices = np.where(y_ajustada >= mitad)[0]
    if len(indices) < 2:
        return np.nan
    return x_ajustada[indices[-1]] - x_ajustada[indices[0]]


